const topicStyle = {
  display: "flex",
  fontWeight: 100,
};

function Topic() {
  return (
    <div>
      <div style={topicStyle}>
        <date>2020.6.30</date>
        <img src="/wineIcon.svg"></img>
        <h4>新しいワインが追加されました！</h4>
      </div>
    </div>
  );
}

export default Topic;
